import React from 'react';
import './Styles/HeaderMain.css';

class HeaderMain extends React.Component{

    render(){
        return(
            <React.Fragment>
            <div id="top-heading">
                <h5 id="slant-heading">The</h5><h5>Siren</h5>
            </div>
            <div id="header-nav">
                {this.props.linklist.map(item_header => 
                    <div class="header-item">
                    <a href={item_header.link} target="_blank">{item_header.title}</a>
                    </div>
                )}
            </div>
            <hr></hr>
            </React.Fragment>
        )
    }
}

export default HeaderMain;
